const socketIOClient = require('socket.io-client');
export class SingletonSocket{
    private static socket:any
    private constructor(){
    }
    public static getSocket() {
        if (!this.socket) {
            this.socket = new SingletonSocket()
        }
        return this.socket
    }
}
